object Solution {
    def numberOfPowerfulInt(start: Long, finish: Long, limit: Int, s: String): Long = {
        var count = 0L
        val suffix = s.toLong
        val maxPrefix = "9" * (s.length - 1)

        (0 to maxPrefix.toInt).foreach { prefix =>
            val num = (prefix.toString + s).toLong
            if (num >= start && num <= finish && num.toString.forall(c => c.asDigit <= limit)) {
                count += 1
            }
        }

        // Check if the suffix itself is within the range and meets the criteria
        if (suffix >= start && suffix <= finish && suffix.toString.forall(c => c.asDigit <= limit)) {
            count += 1
        }

        // Deduct the cases where only the suffix itself was counted without a valid prefix
        if (s.forall(c => c.asDigit <= limit) && s.toLong < start) {
            count -= 1
        }

        count
    }
}
